import React from 'react';
import Layout from '../Templates/Layout';

import Button from 'react-bootstrap/Button';


const LoginPage = () => {
  return (
    <Layout>
      <div className="container fixed-bg text-center">
        <h1 className="text-center">Login Page</h1>
        <p className='sme-form-text'>Sign up for a 30 days free trial</p>
        <p className='sme-form-text-sub'>Limited to 1 employee for this trial</p>
        <form>
          <input className='input-top'
            name='email'
            type='text'
            // onChange={handleChange}
            placeholder="Email"
            // value={formData.nameTop}
          />
          <br></br>
          <input className='input-top'
            name='password'
            type='text'
            // onChange={handleChange}
            placeholder="Password"
            // value={formData.emailTop}
          />
        </form>
        <Button 
          variant="primary" 
          size="lg" 
          className="mt-5 pp-button"
          // onClick={handleClickOpen}
          >
          Login
        </Button>
        {/* <p className='error'>{errorTop}</p> */}
      </div>
    </Layout>
  );
};

export default LoginPage;
